import React, { Component } from "react";
import { Route,BrowserRouter as Router,Switch} from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";
import Plank from "../dashboard/Plank";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";
import Home from "../dashboard/Home";
import Post from "../dashboard/Post";
import Newarticle from "../dashboard/Newarticle";
import EditPost from "../dashboard/EditPost";


import Navbar from "./Navbar";

class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };
render() {
    const { user } = this.props.auth;
return (

      <div className="container valign-wrapper">    
        <div className="row">
          <div className="col s12 center-align"> 

            <button
              style={{
                width: "100px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-small waves-effect waves-light hoverable blue accent-3"
            >
              Logout
            </button>
            <Router>
            <Switch>

               <Route exact path="/dashboard/home" component={(props) => <Home  />} />
               <Route  path="/dashboard/plank" component={(props) => <Plank  />} />
               <Route path="/dashboard/post" component={(props) => <Post  />} />
               <Route path="/dashboard/article" component={(props) => <Article  />} />
               <Route path="/dashboard/:id" render={(props)=> <Newarticle {...props} />} />
               <Route path="/edit-post/:id" render={(props)=> <EditPost {...props} />} />
               <Route  path="/404" component={Notfound} />
             </Switch>
            <Navbar />
            </Router>
          </div>
        </div>      

      </div>

    );
  }
}
Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
  auth: state.auth
});
export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
